text:
Situs Candi Borobudur, salah satu destinasi wisata yang wajib dikunjungi di Indonesia, dari dulu hingga sekarang tetap saja jadi wisata terpopuler.

Harga tiket masuk untuk domestik Rp. 120.000 untuk naik Candi nya. Harga tiket bisa di cek di Situs Resmi soalnya harga dapat berubah. Bisa juga hanya masuk area pelataran nya saja.

Tempatnya bersih terawat, fasilitas juga nyaman, ada musholla, toilet, staff juga pada ramah, guide nya ramah, ada spot souvenir nya di dekat gerbang keluar.

Untuk lebih lengkap kalian bisa cek IG saya dan IG resmi
@hiedzirfahmi13_
@borobudurpark

textTranslated:
The Borobudur Temple site, one of the must-visit tourist destinations in Indonesia, has remained the most popular tourist attraction from the past until now.

The entrance ticket price for domestic is Rp. 120,000 to go up the temple. You can check ticket prices on the Official Site because prices can change. You can also just enter the courtyard area.

The place is clean and well maintained, the facilities are also comfortable, there is a prayer room, toilets, the staff are also friendly, the guides are friendly, there is a souvenir spot near the exit gate.

For more details, you can check my IG and official IG
